from django.shortcuts import render
import random
# Create your views here.
def lotto(request):

    lolist = []

    for i in range(5):    
        lotto = []
        for j in range(6):
            number = random.randint(1,45)
            while number in lotto:
                number = random.randint(1,45)
            lotto.append(number)
        lolist.append(lotto)

    context = {
        'lolist' : lolist,
    }
    return render(request,'lotto.html', context)

